import React from "react";
import cityList from "./city-weather";

function CityList() {
    console.log(cityList);
  return (
    <div>
      {cityList.map((city) => (
        <City name={city.name} countryCode={city.sys.country} main={city.weather.main}/>
      ))}
    </div>
  );
}

function City(props) {
  return (
    <div>
      <h2>{props.name}</h2>
  <span>{props.countryCode}</span>
    </div>
  );
}

export default CityList;
